import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';


class HomeView extends React.Component {
  state = {
    player: {}
  }
  
  componentDidMount() {
    
  }
  
  render() {
    return (
      <div id="intro-text">
        Welcome to the Gameboard, here you can practice an array of skills necessary for survival in this digital age.
        <br />
        Create an account to save your progress and join the leaderboards.
        <br />
        Have fun!
        <div class="gap-20"></div>
        
        <div id="scores-container">
          <Container>
            <Row>
              <Col style={{ height: '20vh'}}>1 of 2</Col>
              <Col>2 of 2</Col>
            </Row>
            <Row>
              <Col>1 of 3</Col>
              <Col>2 of 3</Col>
            </Row>
          </Container>
        </div>
      </div>
    );
  }
}

export default HomeView;
